import React from "react"
import { useNavigate } from "react-router-dom"
import {FaGithub, FaFacebook, FaLinkedin, FaInstagram} from "react-icons/fa"
import { Box, Text, Link, ButtonGroup, Button } from "@chakra-ui/react"

function Footer() {
    const navigate = useNavigate();

    function handleClick(href) {
        navigate(href);
    }

    return (
        <Box 
            position="fixed"
            bottom={0}
            left={0}
            width="100%"
            backgroundColor="gray.400"
            p={4}
            textAlign="center"
        >
            <Text>v2.0</Text>
            <Button variant="ghost"
                    onClick={() => handleClick("https://github.com/yingtu35")}>
                <FaGithub size="24px" />
            </Button>
            <Button colorScheme="linkedin" variant="ghost"><FaLinkedin size="24px" /></Button>
            <Button colorScheme="facebook" variant="ghost"><FaFacebook size="24px" /></Button>
            <Button colorScheme="pink" variant="ghost"><FaInstagram size="24px" /></Button>
        </Box>
    )
}

export default Footer
